Underworld (Brad Armstrong, Wicked Pictures / 2013)

Wicked Pictures and award winning director Brad Armstrong take you on a journey into the UNDERWORLD. Prepare for an erotic masterpiece like no other, one that blends amazing sex, breath-taking visuals, tantalizing costumes, intriguing characters, and out of this world production design. Tanya (jessica drake) and her boyfriend Brian (Steven St. Croix) are mugged by a pair of masked men, as they walk through an underground parking structure. The robbery goes horribly wrong and Tanya is shot. She is rushed to the emergency room and the emergency medical team works feverishly in an attempt to save her life. While in her coma-like state, Tanya enters an eerie UNDERWORLD, a dream-like purgatory where lost souls go to find out their fate. Along the way she meets a cast of mystical characters, each of which relate in some way to things Tanya is experiencing in the operating room above. Every word becomes a vivid, visual image that triggers a reaction in Tanyas subconscious. Scarlet, (Asa Akira) a raven hair temptress draped in red, symbolizesthe blood that flows from Tanyas body. Slice (Xander Corvus) a ghoulish man with long knife-like fingers represents the surgeons scalpel. Mecca (Julia Ann) an automated mechanical woman, is the machinery that is keeping Tanya alive. Gauze (Capri Cavanni) beautiful woman wrapped in fabric signifies Tanya hearing the word gauze over and over in the operating room. Radius(Tommy Gunn) is a barbarian like traveler representing her shattered bones. Stitch (Asphyxia Noir) plays a mischievous doll-like vixen that plays as the sutures that repair Tanyas body. All of these characters help guide Tanya on her journey through the UNDERWORLD. Finally, Tanya meets Death (Derrick Pierce) who has come to take her. Will she be able to beg or barter for her life? Will she finish her journey and live to tell the tale? Get ready to experience the erotic movie adventure of a lifetime.

Adrianna Luna, Asa Akira, Asphyxia Noir, Cameron Dee, Capri Cavanni, jessica drake, Julia Ann, Presley Hart

